amos a buscar las tias con rollazo de la semana y en esta ocasion Alex Moreno ha ido al bar de moda de la zona para encontrar a su camarera mas cachonda. Vaya follada le va a pegar Christian a esta chica que, con sus curvas naturales, tiene un movimiento de cadera fuera de lo normal.
